import { useEffect, useState } from "react";

export default function HostCars() {
  const [cars, setCars] = useState([]);
  useEffect(() => {
    const getCars = async () => {
      try {
        const res = await fetch("/api/cars");
        const data = res.json();
        setCars(data.cars);
      } catch(err) {
        if (err) {
          throw new Error("Something went wrong...");
        }
      }
    };
    getCars();
  });
  console.log(cars);
